      content: >-
        Day 1:

        Those fools at the academy doubted my methods. Demanded I be stripped of my license. No matter! Out here in space I can find some clientel who are more appreciative of my talents. I've wound up aboard this medical station, and should be able to find some travelers willing to indulge...


        Day 4:

        Finally! A willing subject! A tall and muscular reptilian, requesting an organ transplantation. I happen to have some spare from a friendly salvager, Let's see how they'll like breathing without air!


        Day 6: The reptilian was most pleased, though i havent had enough funds yet to replenish my stock of anaesthetic...


        Day 10: I've reached a breakthrough, one of the passengers visiting this station has some... unique aesthetic traits. I can smell perfection on the horizon, if only I could convince them...


        Day ??: It's happened, and they all doubted me, hah! The subject is still fully alive, despite having to reroute their digestive systems back together, I'm sure they'd agree this is a much better state than their previous... They may not live for long if they keep refusing to eat, but the two of them are just so perfect this way...
