    - type: Paper
      stampState: paper_stamp-signature
      stampedBy:
      - stampedColor: '#2F4F4FFF'
        stampedName: Jasper Rummin
      - stampedColor: '#3681BBFF'
        stampedName: stamp-component-stamped-name-captain
      content: >
        I write my thoughts onto this note as there is a bit of a lull piloting this spaceship.


        NTDV Bureaucrat QT-560 seems to have been a fine ship in her prime days. But now it has set out for her last voyage to her final resting place at Byoin station and is slated to be decommissioned upon her arrival.


        It seems that Central Command wants to repurpose this ship to serve as the Justice Department for the new station they just got online. That station seems to be a good little station, so much so that they want to increase its capacity without having to spend to much resources on this endeavor.


        When I get there, though, I have to coordinate with the engineers of the station to remove all useful parts that Central Command can use elsewhere and permanently attach her to the station hull and connect her subsystem to the station subsystem.


        The escort ship that will take me and the parts back to Central Command has been great company on this voyage, I have nothing but praise for them.



        Regards:

        Captain, Jasper Rummin.
      editingDisabled: True
