        [color=#505d96][/color][color=#39436e][/color][color=#39436e][color=#505d96][/color][color=#39436e][/color][color=#505d96][/color][color=#39436e][/color] [bold][color=#366124] STATION: [/color][/bold]Byin [color=#374387][/color]

