        [color=#366124][head=2][bold]CENTRAL COMMAND NOTICE[/head][/bold][/color]

        [color=#161926][/color]

        [bold][color=#366124]Subject: [/color][/bold]RECONSTRUCTION OF JUSTICE[color=#374387][/color]


        [head=2][italic]Greetings Command[/italic][/head]


        It has come to our attention that a severe impact from a rogue meteor has hit the justice department aboard Byin, and the hull integrity of NTDV Bureaucrat QT-560 used to hold justice, is severely compromised.


        Our dispatch of engineers cleared out the remains of any meteor fragments to better survey the damages and has deemed it too costly to get her spaceworthy again for a ship never meant to fly again. Our structural engineers have told us towing her via FTL for scraping would result in total structural breakdown. And thus we have decided to undock her from the arrival docks to free up the space once more and moor her up alongside extended confinement facilities of the station for the remainder of the station's lifetime.


        The engineers have taken anything of worth from the ship to be used in the reconstruction of a proper justice department for the station. Feel free to use anything that is left on the shuttle as you wish. Central Command has stricken this vessel from its rosters, and it is, to all intents and purposes, considered scrap.


        [bold]END OF FAX[/bold][/color]

        [color=#161926][/color]

        [color=#366124][bold][head=3][italic]CENTRAL COMMAND OFFICIAL DOCUMENT[/italic][/bold][/head][/color]
